## Remarks  
 El <xref:System.ServiceModel.Channels.HttpResponseMessageProperty.SuppressPreamble%2A> propiedad permite a los usuarios escribir contenido en el <xref:System.Web.HttpResponseBase.OutputStream%2A> desde dentro de un cuerpo de la operación de WCF. Esto surte efecto sólo en escenarios de webhosted. El <xref:System.ServiceModel.Channels.HttpResponseMessageProperty.SuppressPreamble%2A> propiedad es `false` de forma predeterminada.  
  
> [!WARNING]
>  Si el <xref:System.ServiceModel.Channels.HttpResponseMessageProperty.SuppressPreamble%2A> propiedad está establecida en `true`, debe establecer el código de estado del tipo de contenido, encabezados, en la respuesta porque WCF ya no lo hará.  
  
 El código siguiente muestra un ejemplo de cómo hacerlo.  
  
```  
public class Service1 : IService1  
{  
   public void GetData()  
   {  
      HttpContext hc = HttpContext.Current;  
      string str = @"<?xml version=""1.0"" encoding=""utf-8"" ?>";  
      byte[] buffer = new byte[str.Length];  
      buffer = ASCIIEncoding.UTF8.GetBytes(str);  
  
      // enable the property  
      HttpResponseMessageProperty responseProperty = new HttpResponseMessageProperty();  
      responseProperty.SuppressPreamble = true;  
      OperationContext.Current.OutgoingMessageProperties[HttpResponseMessageProperty.Name] = responseProperty;  
  
      // set the response   
      hc.Response.StatusCode = 200;  
      hc.Response.ContentType = "text/xml; charset=utf-8";  
      hc.Response.ClearContent();  
      hc.Response.Flush();  
  
      hc.Response.OutputStream.Write(buffer, 0, buffer.Length);  
     hc.Response.Flush();  
   }  
}  
```
